import React from 'react'
import cl from './userModal.module.scss'

const UserModal = ({ darkMode, userModal }) => {
  return (
    <div className={userModal ? [cl.userModal, cl.open].join(' ') : cl.userModal}>
      <ul className={cl.userModal__list}></ul>
    </div>
  )
}

export default UserModal
